import React from 'react'
import { useState } from 'react'

 const Hover = () => {
    const[data,setdata]=useState(0)
    const handlechange =() =>{
          setdata(data+1);
    }
  return (
    <div>
        <button onm={handlechange}> Hovered {data} Times </button>
    </div>
  )
}
export default Hover
